import React from 'react'

const CollectionItem = ({art}) => {
  return(
    <div>
      <div className="card z-depth-0 white" key={art.id}>
        <img
          src={art.imageUrl}
          alt="your collection"
          className="responsive-img"/>
      </div>
    </div>
  )
}

export default CollectionItem
